!!','e8a6b9c0ff4','pt-br','Como matar o enderdragon','cf1e8a6b9c0','1714146004788','Minecrafters',NULL,0.99,'image','pending',NULL),('8c32c640415','https://app.agencyboz.com:4112/static/courses/8c32c640415/2e6ebeea-19db-44c0-8c9a-bccc728f18bc.jpeg','Este curso de 60 horas é dedicado a ensinar Angular, focando em desenvolvimento robusto e escalável de aplicações web. Através de aulas detalhadas e 5 projetos práticos, os alunos aprenderão a construir aplicações interativas e eficientes, dominando o framework Angular e suas poderosas funcionalidades.','b98c32c6404','pt-br','Desenvolvimento Avançado com Angular: Curso Intensivo','7cf1e8a6b9c','1714149189707','',NULL,150,'image','pending',NULL),('b537e7b73af','https://app.agencyboz.com:4112/static/courses/b537e7b73af/423F27B9-31BB-405B-823F-97BC8C627169.jpg','Venha conhecer o mundo das modelagens! Aqui você aprenderá a fazer moldes de qualquer personagem e personaliza-los que você quer.','41517cb811e','pt-br','Curso de modelagem em pasta americana','77cf1e8a6b9','1714150226593','',NULL,450,'image','pending',NULL),('c0ff431affd','https://app.agencyboz.com:4112/static/courses/c0ff431affd/13fe18bc-a3fa-4a00-96de-bf71f07e494f.jpeg','Explore a fundo o desenvolvimento web neste curso de 65 horas, abrangendo HTML, CSS e JavaScript. Construa 8 projetos práticos que vão desde simples páginas web até aplicações interativas avançadas. Ideal para iniciantes e desenvolvedores que desejam aprimorar suas habilidades.','b9c0ff431af','pt-br','Desenvolvimento Web Completo: Do HTML ao JavaScript','7cf1e8a6b9c','1714147830098','',NULL,150,'image','pending',NULL),('d1067e28b98','https://app.agencyboz.com:4112/static/courses/d1067e28b98/d46a4a13-4fcd-48cc-99f0-17cf1b838674.jpeg','Aprenda a construir sites profissionais com WordPress e Elementor neste curso intensivo de 40 horas. Através de instruções detalhadas e a realização de 4 projetos práticos, você dominará as técnicas de design web, otimização e personalização para criar sites impressionantes e funcionais.','ffd1067e28b','pt-br','Criação de Sites com WordPress e Elementor: Curso Prático','7cf1e8a6b9c','1714147981103','',NULL,200,'image','pending',NULL),('e28b98c32c6','https://app.agencyboz.com:4112/static/courses/e28b98c32c6/8c9522b9-134b-44fe-8f30-a1420eee85e1.jpeg','Este curso de 50 horas oferece uma imersão profunda em Vue.js e Tailwind CSS, duas das tecnologias mais populares no desenvolvimento frontend. Você irá desenvolver habilidades práticas através da construção de 5 projetos práticos, aprendendo a criar interfaces ricas e responsivas com eficiência e estilo.','67e28b98c32','pt-br','Desenvolvimento Frontend Avançado com Vue.js e Tailwind CSS','7cf1e8a6b9c','1714148957442','',NULL,150,'image','pending',NULL);
