INSERT INTO `Lesson` (`id`, `published`, `name`, `info`, `pdf`, `course_id`, `active`, `media_id`, `thumb`, `status`, `declined_reason`) VALUES ('0e67ded2503','1714156880564','Ferramentas de Design no Figma','Aprenda a utilizar as principais ferramentas e recursos do Figma para criar designs de interface desde o zero.',NULL,'64041517cb8',1,'30e67ded250','https://app.agencyboz.com:4112/static/course/lessons/64041517cb8/bcecb4fd-24ae-47a9-858b-a4f5c69c6a7f.jpeg','pending',NULL),('130e67ded25','1714156757850','Introdução ao Figma\nDescrição','Conheça o Figma, uma ferramenta poderosa de design de interface, explorando sua interface de usuário e funcionalidades básicas.',NULL,'64041517cb8',1,'a130e67ded2','https://app.agencyboz.com:4112/static/course/lessons/64041517cb8/048cd148-8fb2-453f-ad2e-be19aa51b436.jpeg','pending',NULL),('3afd790b26d','1714150513224','Materiais Básicos ','Nesta aula você aprenderá quais ferramentas sao essenciais pra começar a modelagem de personagens.',NULL,'b537e7b73af',1,'73afd790b26','https://app.agencyboz.com:4112/static/course/lessons/b537e7b73af/305E5FC5-23F1-4842-BE7D-5EB4E2A7EA5A.jpg','pending',NULL),('3bfa130e67d','1714156482219','Plugins Essenciais','Descubra os plugins mais úteis para expandir as funcionalidades do seu site WordPress, incluindo dicas de segurança e SEO.',NULL,'d1067e28b98',1,'23bfa130e67','https://app.agencyboz.com:4112/static/course/lessons/d1067e28b98/341e1f8c-ea14-4daf-8e0c-206a194ee9b2.jpeg','pending',NULL),('5d83d263e7d','1714153776482','Introdução ao React','Comece a explorar o React, aprendendo sobre JSX, componentes, estados e props para construir interfaces de usuário dinâmicas e reativas.',NULL,'31affd1067e',1,'55d83d263e7','https://app.agencyboz.com:4112/static/course/lessons/31affd1067e/9cb4fee7-0381-4856-8ff2-c35756612e97.jpeg','pending',NULL),('63e7d585923','1714154898571','Estilizando com Material-UI','Aprenda a usar o Material-UI para aplicar estilos e temas nos seus projetos React, criando interfaces atraentes e consistentes com facilidade.',NULL,'31affd1067e',1,'263e7d58592','https://app.agencyboz.com:4112/static/course/lessons/31affd1067e/f917db59-d153-4c7a-9f2c-feaec2a0879f.jpeg','pending',NULL),('67ded2503fc','1714156937572','Prototipagem com Figma','Explore a prototipagem no Figma para criar interações e transições dinâmicas entre telas de seu projeto de interface.',NULL,'64041517cb8',1,'e67ded2503f','https://app.agencyboz.com:4112/static/course/lessons/64041517cb8/6834f746-a690-42f8-8f74-47491714ca40.jpeg','pending',NULL),('83d263e7d58','1714153885928','Gerenciamento de Estado com Hooks','Aprofunde o uso de Hooks no React para gerenciar o estado e o ciclo de vida dos componentes de maneira eficiente e moderna.',NULL,'31affd1067e',1,'d83d263e7d5','https://app.agencyboz.com:4112/static/course/lessons/31affd1067e/c47f8e49-4abc-4f7d-9143-65c274fe9eaf.jpeg','pending',NULL),('85923bfa130','1714156347358','Primeiros Passos com Elementor','Aprenda a utilizar o Elementor para criar páginas visualmente atraentes, utilizando seu sistema de arrastar e soltar para design.',NULL,'d1067e28b98',1,'585923bfa13','https://app.agencyboz.com:4112/static/course/lessons/d1067e28b98/521c6956-15f0-4fed-9dbf-3c7bab8c155f.jpeg','pending',NULL),('88c55d83d26','1714153028449','Integrando HTML, CSS e JavaScript','Aprenda a integrar HTML, CSS e JavaScript para criar uma página web dinâmica e interativa, focando na manipulação do DOM e na criação de uma experiência de usuário aprimorada.',NULL,'c0ff431affd',1,'d88c55d83d2','https://app.agencyboz.com:4112/static/course/lessons/c0ff431affd/f7c6f5c5-6b35-420f-a3f6-6cbb6da4b0ba.jpeg','pending',NULL),('90b26de2996','1714151785870','Passo 2: Enfrentando o dragão','Conforme descrito na lição 2 opcional (recomendo le-la!!!), o enderdragon regenera a vida com as estrelas das torres. Ou seja, tentar matá-lo no começo é INÚTIL E IDIOTICE!!! Você precisa primeiro destruir essas estrelas. Depois de destrui essas estrelas, espere o dragão chegar bem perto e dê um golpe crítico (pule e ataque ao cair) com sua espada de diamante. Use também o arco/besta para acertá-lo enquanto ele voa!!! Sugiro armas encantadas para que seja mais rápido.',NULL,'8a6b9c0ff43',1,'790b26de299','https://app.agencyboz.com:4112/static/course/lessons/8a6b9c0ff43/935261bc-6c86-4366-b06b-aecdb1ab1113.jpeg','pending',NULL),('923bfa130e6','1714156408929','Customização de Temas','Explore como customizar temas no WordPress com Elementor, ajustando o design ao seu gosto e às necessidades do seu site',NULL,'d1067e28b98',1,'5923bfa130e','https://app.agencyboz.com:4112/static/course/lessons/d1067e28b98/04f43f58-6c6c-4849-acf5-cccade55ada2.jpeg','pending',NULL),('b73afd790b2','1714150512105','Introdução ao HTML','Aprenda a estrutura básica de uma página HTML, incluindo tags, atributos e elementos essenciais para criar o esqueleto de um website.',NULL,'c0ff431affd',1,'7b73afd790b','https://app.agencyboz.com:4112/static/course/lessons/c0ff431affd/7329ffb6-677b-41bd-b411-619b40cc7d9e.jpeg','pending',NULL),('c2cbdd88c55','1714152721365','Tutorial de como usar o arco','Assista o vídeo e você vai descobrir todo o potencial de usar o arco e flecha no Minecraft! Não se preocupe mais com flechas! Esqueletos vão morrer num instante!',NULL,'2426c2cbdd8',1,'6c2cbdd88c5','https://app.agencyboz.com:4112/static/course/lessons/2426c2cbdd8/8cd5a729-8e3c-456c-8ce1-f12bbe9bb0b6.png','pending',NULL),('c55d83d263e','1714153094554','Projeto Prático Final','Coloque em prática tudo que aprendeu no curso desenvolvendo um projeto web completo, que integra HTML, CSS e JavaScript para criar um site funcional e atraente.\nAgora, vou gerar a imagem neutra para este curso e, em seguida, proceder com os planos de lição para os outros cursos mencionados.',NULL,'c0ff431affd',1,'8c55d83d263','https://app.agencyboz.com:4112/static/course/lessons/c0ff431affd/fce53132-a85a-44b7-8d29-027c52efd27e.jpeg','pending',NULL),('cbdd88c55d8','1714152901794','Estilizando com CSS','Aprenda a estrutura básica de uma página HTML, incluindo tags, atributos e elementos essenciais para criar o esqueleto de um website.',NULL,'c0ff431affd',1,'2cbdd88c55d','https://app.agencyboz.com:4112/static/course/lessons/c0ff431affd/8e446392-5839-42f2-9f2d-dd05059922ed.jpeg','pending',NULL),('d2503fc54d4','1714159166114','De Design à Implementação','Aprenda a transformar seus designs do Figma em código real, explorando as melhores práticas para desenvolvedores trabalharem com designers',NULL,'64041517cb8',1,'ed2503fc54d','https://app.agencyboz.com:4112/static/course/lessons/64041517cb8/fb94ca8e-4e53-4205-b178-7e864b97ec62.jpeg','pending',NULL),('d263e7d5859','1714154794668','Desenvolvimento com TypeScript','Integre TypeScript no seu workflow do React para adicionar tipos estáticos, melhorando a manutenibilidade e a escalabilidade dos aplicativos.',NULL,'31affd1067e',1,'3d263e7d585','https://app.agencyboz.com:4112/static/course/lessons/31affd1067e/80e25533-6a47-4902-91d7-30ed3d140f7f.jpeg','pending',NULL),('d585923bfa1','1714156284801','Fundamentos do WordPress','Introdução ao WordPress, explorando sua interface, configurações principais e como gerenciar conteúdo eficazmente.',NULL,'d1067e28b98',1,'7d585923bfa','https://app.agencyboz.com:4112/static/course/lessons/d1067e28b98/21b66a95-382e-4714-9703-91053a61ab0a.jpeg','pending',NULL),('dd88c55d83d','1714152964238','Fundamentos do JavaScript','Introdução aos conceitos básicos de JavaScript, incluindo variáveis, tipos de dados, funções e eventos, fundamentais para interatividade no desenvolvimento web.',NULL,'c0ff431affd',1,'bdd88c55d83','https://app.agencyboz.com:4112/static/course/lessons/c0ff431affd/8169d8f4-565e-4d4b-be82-2ef8a83a8ad8.jpeg','pending',NULL),('ded2503fc54','1714159057588','Colaboração e Feedback','Utilize os recursos de colaboração do Figma para trabalhar em equipe e integrar feedbacks de forma eficaz e eficiente.',NULL,'64041517cb8',1,'7ded2503fc5','https://app.agencyboz.com:4112/static/course/lessons/64041517cb8/31992e9b-8571-47e6-bf59-246d300ea359.jpeg','pending',NULL),('e7b73afd790','1714150365064','Primeiro passo: conseguir um set de diamante','Isso aqui é na verdade um pré-requisito. O set de diamante é necessário para primeiro chegar na fortaleza e montar o portal do end, porque é muito difícil e perigoso. Isso piora ainda quando você vai pro end, porque tem um monte de endermen e eles causam muito dano.',NULL,'8a6b9c0ff43',1,'7e7b73afd79','https://app.agencyboz.com:4112/static/course/lessons/8a6b9c0ff43/5356525b-7e36-4752-b7c8-4edf611a1053.jpeg','pending',NULL),('e7d585923bf','1714154942731','Projeto Prático Integrado','Combine React, TypeScript e Material-UI em um projeto prático final, consolidando seu aprendizado com a criação de uma aplicação web completa e responsiva.',NULL,'31affd1067e',1,'3e7d585923b','https://app.agencyboz.com:4112/static/course/lessons/31affd1067e/9f871f10-61af-4900-b818-992e7c4996ab.jpeg','pending',NULL),('fa130e67ded','1714156544313','Criando um Portfólio','Utilize suas habilidades aprendidas para construir um portfólio impressionante no WordPress com Elementor, demonstrando seu trabalho de forma profissional.',NULL,'d1067e28b98',1,'bfa130e67de','https://app.agencyboz.com:4112/static/course/lessons/d1067e28b98/afa42e8e-2947-4874-8840-1ece0a41242c.jpeg','pending',NULL),('fd790b26de2','1714150651931','Opcional: ter armas de distância','Para matar o enderdragon, você precisa destruir as estrelas no topo das torres que regeneram a vida do dragão. Usar um arco ou besta ajuda bastante nisso, pois aí você não precisa subir nessas torres pra destruir na mão.\n\nTAMBÉM RECOMENDO PARA MATAR O DRAGÃO EM SI!!!',NULL,'8a6b9c0ff43',1,'afd790b26de','https://app.agencyboz.com:4112/static/course/lessons/8a6b9c0ff43/fc4ab708-1613-4671-8b4f-0892c001bdaf.png','pending',NULL);
